import React, { useState } from "react";
import {
  Card,
  Form,
  Button,
  Alert,
  ProgressBar,
  Spinner,
} from "react-bootstrap";
import studentService from "../../services/studentService";

const ExcelUpload = ({ onExcelUploaded }) => {
  const [selectedFile, setSelectedFile] = useState(null);
  const [uploading, setUploading] = useState(false);
  const [uploadResult, setUploadResult] = useState(null);
  const [error, setError] = useState("");

  // Validate file type
  const handleFileSelect = (event) => {
    const file = event.target.files[0];
    if (
      file &&
      (file.type ===
        "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet" ||
        file.type === "application/vnd.ms-excel")
    ) {
      setSelectedFile(file);
      setUploadResult(null);
      setError("");
    } else {
      setSelectedFile(null);
      setError("Please select a valid Excel file (.xlsx or .xls)");
    }
  };

  // Upload Excel file
  const handleUpload = async () => {
    if (!selectedFile) {
      setError("Please select a file first");
      return;
    }

    setUploading(true);
    setError("");
    try {
      const result = await studentService.uploadExcel(selectedFile);
      setUploadResult(result.summary);
      onExcelUploaded?.(result.summary);
      setSelectedFile(null);

      // Reset file input
      document.getElementById("excel-upload").value = "";
    } catch (err) {
      console.error("Upload error:", err);
      setError("Failed to upload Excel file");
    } finally {
      setUploading(false);
    }
  };

  // Download sample template
  const downloadSample = async () => {
    try {
      const blob = await studentService.downloadSampleExcel();
      const url = window.URL.createObjectURL(blob);
      const link = document.createElement("a");
      link.href = url;
      link.download = "student-template.xlsx";
      document.body.appendChild(link);
      link.click();
      document.body.removeChild(link);
      window.URL.revokeObjectURL(url);
    } catch (err) {
      console.error("Download error:", err);
      setError("Failed to download sample template");
    }
  };

  return (
    <Card className="shadow-sm border-0">
      {/* Header */}
      <Card.Header className="bg-secondary text-white d-flex align-items-center">
        <i className="bi bi-upload me-2 fs-5"></i>
        <h6 className="mb-0">Bulk Upload Students</h6>
      </Card.Header>

      {/* Body */}
      <Card.Body>
        {error && (
          <Alert
            variant="danger"
            dismissible
            onClose={() => setError("")}
            className="py-2"
          >
            <i className="bi bi-exclamation-circle me-2"></i>
            {error}
          </Alert>
        )}

        <Form>
          {/* File Input */}
          <Form.Group className="mb-3">
            <Form.Label className="fw-semibold">Select Excel File</Form.Label>
            <Form.Control
              id="excel-upload"
              type="file"
              accept=".xlsx,.xls"
              onChange={handleFileSelect}
            />
            <Form.Text className="text-muted">
              Supported formats: <code>.xlsx</code>, <code>.xls</code>
            </Form.Text>
          </Form.Group>

          {/* Action Buttons */}
          <div className="d-grid gap-2">
            <Button
              variant="primary"
              onClick={handleUpload}
              disabled={!selectedFile || uploading}
              className="d-flex align-items-center justify-content-center gap-2"
            >
              {uploading ? (
                <>
                  <Spinner animation="border" size="sm" /> Uploading...
                </>
              ) : (
                <>
                  <i className="bi bi-cloud-arrow-up"></i> Upload Excel
                </>
              )}
            </Button>

            <Button
              variant="outline-secondary"
              onClick={downloadSample}
              className="d-flex align-items-center justify-content-center gap-2"
            >
              <i className="bi bi-download"></i> Download Sample Template
            </Button>
          </div>

          {/* Progress Bar */}
          {uploading && (
            <div className="mt-3">
              <ProgressBar animated now={100} />
            </div>
          )}
        </Form>

        {/* Upload Results */}
        {uploadResult && (
          <Alert
            variant={uploadResult.failed > 0 ? "warning" : "success"}
            className="mt-3"
          >
            <Alert.Heading as="h6">ðŸ“Š Upload Results</Alert.Heading>
            <p className="mb-2">
              Total Records: <strong>{uploadResult.total}</strong> <br />
              Successfully Added:{" "}
              <strong className="text-success">{uploadResult.successful}</strong>{" "}
              <br />
              Failed:{" "}
              <strong className="text-danger">{uploadResult.failed}</strong>
            </p>

            {uploadResult.errors && uploadResult.errors.length > 0 && (
              <div>
                <strong>Errors:</strong>
                <ul className="mt-2 mb-0 small text-danger">
                  {uploadResult.errors.slice(0, 5).map((error, index) => (
                    <li key={index}>
                      Row {error.row}: {error.error}
                    </li>
                  ))}
                  {uploadResult.errors.length > 5 && (
                    <li>
                      ... and {uploadResult.errors.length - 5} more errors
                    </li>
                  )}
                </ul>
              </div>
            )}
          </Alert>
        )}
      </Card.Body>
    </Card>
  );
};

export default ExcelUpload;
